var express = require('express');
var router = express.Router();
let vikrant ="data:image/jpeg;base64,";
let chirag = "data:image/jpeg;base64,"
let amit = "data:image/png;base64,"
let shreyansh = "data:image/jpeg;base64,"
let viditsaurav = "data:image/jpeg;base64,"
/* GET home page. */
router.get('/', function(req, res, next) {
  if(req.headers.from && req.headers.from.includes("@iiitvadodara.ac.in")){
    if(req.headers['accept-language']=='minecraft-enchantment-table'){
      if(req.headers['user-agent']=='IIITVBrowser'){
        if(req.headers.date && req.headers.date.includes('1921')){
          res.render('index',{img: viditsaurav,text:"flag{y0u_m4y_pr0c33d_t0_n3xt_l3v3l}"})
        }
        else{
          res.render('index',{img: chirag, text: 'You are only a century late!, this website used to work in 1921'});
        }
      }
      else{
        res.render('index',{img: shreyansh, text: 'I only allow users from IIITVBrowser'});
      }
    }
    else{
        res.render('index',{img: amit, text: '!  -:   -    -  '});
    }
  }
  else{
    res.render('index',{img: vikrant, text: 'I only allow students from IIIT Vadodara'});
  }
});

module.exports = router;
